import React from "react";
import Note from "./Note";

const NoteList = ({ notes, toggleComplete, removeNote }) => {
  return (
    <ul>
      {notes.map(note => (
        <Note
          key={note.id}
          note={note}
          toggleComplete={toggleComplete}
          removeNote={removeNote}
        />
      ))}
    </ul>
  );
};

export default NoteList;
